import MainNavbar from "../navbar/MainNavbar";
import Banner from "../landing page/Banner"

const LandingPage = (props) => {
    
    return (
        <div>
            <MainNavbar></MainNavbar>
            <div className="container">
                <Banner></Banner>
            </div>
        </div>
    )
};

export default LandingPage;
